INSERT INTO public.foods VALUES (6, 'banana', 'fruit', 'SAFE', 'Small pieces okay; high sugar—use as occasional treat.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (7, 'blueberry', 'fruit', 'SAFE', 'Small handful okay; rich in fiber—introduce slowly.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (8, 'strawberry', 'fruit', 'SAFE', 'Small amounts okay; cut into pieces; high natural sugars.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (9, 'raspberry', 'fruit', 'CAUTION', 'Small amounts only; naturally contain trace xylitol; monitor for GI upset.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (10, 'watermelon (seedless, no rind)', 'fruit', 'SAFE', 'Seedless only and remove rind.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (11, 'cantaloupe (no rind)', 'fruit', 'SAFE', 'No rind; small amounts due to sugar.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (12, 'mango (peeled, pitted)', 'fruit', 'SAFE', 'Peel and remove pit; serve small pieces.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (13, 'pineapple (cored)', 'fruit', 'SAFE', 'Core and serve small amounts; high in sugar/fiber.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (14, 'pear (no seeds/core)', 'fruit', 'SAFE', 'Remove seeds/core; small amounts due to fiber/sugar.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (15, 'cranberry', 'fruit', 'SAFE', 'Tart; small amounts only; avoid sweetened juices/dried with sugar.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (16, 'orange segments', 'fruit', 'CAUTION', 'Acidic; small segments only; many dogs dislike citrus.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (17, 'peach (no pit)', 'fruit', 'CAUTION', 'No pit (cyanogenic); small amounts only due to sugar/fiber.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (18, 'nectarine (no pit)', 'fruit', 'CAUTION', 'No pit; small portions.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (19, 'plum (no pit)', 'fruit', 'CAUTION', 'No pit; flesh in small amounts only.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (20, 'cherry (no pit/stem)', 'fruit', 'CAUTION', 'No pits/stems (cyanogenic); small amounts; many dogs dislike.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (21, 'avocado (ripe flesh only)', 'fruit', 'CAUTION', 'Avoid pit/skin/plant; small amounts of ripe flesh may be tolerated but best avoided in many guides.', '{akc.org,aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (22, 'pomegranate', 'fruit', 'CAUTION', 'Seeds may cause GI upset; small amounts only; many dogs don’t tolerate well.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (23, 'fig', 'fruit', 'CAUTION', 'May cause GI upset; small amounts only; avoid leaves/plant.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (24, 'kiwi (peeled)', 'fruit', 'SAFE', 'Peel; slice; small amounts due to fiber/acidity.', '{akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (25, 'grapefruit', 'fruit', 'CAUTION', 'Citrus oils/acidity can cause GI upset; avoid rind/pith; many guides advise avoiding.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (26, 'tangerine', 'fruit', 'CAUTION', 'Citrus; small amounts only; avoid peel/pith; many dogs dislike.', '{akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (27, 'cucumber', 'vegetable', 'SAFE', 'Low-calorie treat; slice; avoid seasoning.', '{akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (28, 'zucchini', 'vegetable', 'SAFE', 'Small amounts; plain.', '{akc.org,aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (29, 'green beans', 'vegetable', 'SAFE', 'Plain fresh/frozen/cooked; avoid salt and seasoning.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (30, 'pumpkin (plain)', 'vegetable', 'SAFE', 'Plain cooked/canned pumpkin (not pie mix); useful for GI in moderation.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (31, 'sweet potato (plain cooked)', 'vegetable', 'SAFE', 'Cooked plain; small amounts; high fiber—introduce slowly.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (32, 'potato (plain cooked, no green parts)', 'vegetable', 'CAUTION', 'Cooked plain only; avoid green/raw (solanine).', '{merckvetmanual.com,petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (33, 'spinach', 'vegetable', 'CAUTION', 'Oxalates; small amounts only; not for dogs with kidney issues.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (34, 'kale', 'vegetable', 'CAUTION', 'Goitrogens; small amounts only; avoid for dogs with thyroid issues.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (35, 'broccoli (florets only)', 'vegetable', 'CAUTION', 'Small amounts; may cause gas; avoid large stems/choking hazard.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (36, 'cauliflower', 'vegetable', 'CAUTION', 'Small amounts; may cause gas.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (37, 'celery', 'vegetable', 'SAFE', 'Small sticks; low-calorie; watch stringy fibers.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (38, 'asparagus (cooked)', 'vegetable', 'CAUTION', 'Cooked pieces only; fibrous/raw is hard to digest; many guides advise avoiding.', '{akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (39, 'beets (cooked)', 'vegetable', 'CAUTION', 'Cooked; can stain; may cause GI upset in some dogs.', '{akc.org,aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (40, 'bell pepper (no seeds/stem)', 'vegetable', 'SAFE', 'Red/yellow/green ok in small amounts; remove seeds/stem.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (41, 'jalapeño/hot peppers', 'vegetable', 'UNSAFE', 'Spicy foods can cause GI upset; capsaicin irritation—avoid.', '{petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (42, 'mushrooms (store-bought only)', 'vegetable', 'CAUTION', 'Only store-bought culinary mushrooms in small amounts; wild mushrooms can be highly toxic.', '{aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (43, 'garlic chives/leeks/scallions', 'vegetable', 'UNSAFE', 'Allium family—risk of hemolytic anemia; avoid in all forms.', '{merckvetmanual.com,aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (44, 'lima beans (cooked, plain)', 'legume', 'SAFE', 'Cooked plain; small amounts only.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (45, 'peas (plain, cooked/frozen)', 'legume', 'SAFE', 'Plain; avoid canned with salt; watch for pea protein allergies.', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (46, 'edamame (plain, shelled)', 'legume', 'CAUTION', 'Soy—introduce slowly; some dogs may be intolerant; avoid seasonings.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (47, 'lentils (cooked, plain)', 'legume', 'SAFE', 'Cooked; small amounts; watch for gas.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (48, 'chickpeas/garbanzo (plain cooked)', 'legume', 'CAUTION', 'Cooked plain; can cause gas; avoid hummus/seasoning.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (49, 'tofu (plain)', 'legume', 'CAUTION', 'Soy product; small amounts only; check for soy allergies.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (50, 'oats (plain cooked oatmeal)', 'grain', 'SAFE', 'Plain cooked; no sugar/salt; good fiber source in moderation.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (51, 'quinoa (plain cooked)', 'grain', 'SAFE', 'Rinse and cook; small amounts; complete protein.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (52, 'barley (plain cooked)', 'grain', 'SAFE', 'Cooked plain; fiber source; introduce slowly.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (53, 'whole wheat pasta (plain cooked)', 'grain', 'CAUTION', 'Plain, small amounts; gluten sensitivity possible; avoid sauces.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (54, 'bread (plain, no raisins/xylitol)', 'grain', 'CAUTION', 'Small amounts plain; avoid raisins/xylitol; not nutritionally necessary.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (55, 'corn (plain, off cob)', 'grain', 'CAUTION', 'Plain kernels ok; avoid corn cobs (choking/obstruction risk).', '{akc.org,merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (56, 'popcorn (plain, air-popped)', 'grain', 'CAUTION', 'Plain only; no butter/salt; risk of hulls/lodging.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (57, 'peanut butter (xylitol-free)', 'spread', 'CAUTION', 'Ensure **xylitol-free**; small amounts due to fat/calories.', '{petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (58, 'almonds', 'nut', 'CAUTION', 'High fat; choking risk; many guides recommend avoiding.', '{aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (59, 'cashews (plain, unsalted)', 'nut', 'CAUTION', 'Small amounts only; high fat; avoid salted/seasoned.', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (60, 'peanuts (plain, unsalted)', 'nut', 'CAUTION', 'Many dogs tolerate small amounts; ensure no xylitol; high fat.', '{akc.org,merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (61, 'pistachios', 'nut', 'CAUTION', 'High fat; salted often; shell hazard; many guides: avoid.', '{aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (62, 'walnuts', 'nut', 'CAUTION', 'Some types/mold risk; GI upset; better to avoid.', '{petpoisonhelpline.com,aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (63, 'pecans', 'nut', 'CAUTION', 'Mold/toxin risk (tremorgenic mycotoxins) when spoiled; high fat.', '{petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (64, 'hazelnuts', 'nut', 'CAUTION', 'High fat; choking hazard; small amounts at most; many advise avoiding.', '{aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (65, 'brazil nuts', 'nut', 'CAUTION', 'Very high fat; avoid or tiny amounts only.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (66, 'sunflower seeds (unsalted, shelled)', 'seed', 'CAUTION', 'Small amounts; remove shells; avoid salt/seasoning.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (67, 'pumpkin seeds (plain, shelled)', 'seed', 'CAUTION', 'Plain, shelled; small amounts; avoid salt/seasoning.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (68, 'chia seeds (soaked)', 'seed', 'CAUTION', 'Soak; small amounts for fiber/omega-3; can cause GI upset if dry.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (69, 'flaxseed (ground)', 'seed', 'CAUTION', 'Ground; small amounts; omega-3; can affect stool; avoid whole seeds.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (70, 'plain yogurt (no xylitol)', 'dairy', 'CAUTION', 'Small amounts; lactose sensitivity possible; ensure no xylitol/sweeteners.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (71, 'cottage cheese (low-fat)', 'dairy', 'CAUTION', 'Small amounts; lactose/fat can cause GI upset; choose low-fat, plain.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (72, 'milk (plain, small amounts)', 'dairy', 'CAUTION', 'Many dogs are lactose-intolerant; small amounts only if tolerated.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (73, 'goat milk (plain)', 'dairy', 'CAUTION', 'Small amounts; still lactose; monitor tolerance.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (74, 'ice cream (plain, no xylitol)', 'dessert', 'CAUTION', 'Not recommended; lactose/sugar/fat; if ever, a tiny plain lick; ensure no xylitol.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (75, 'whipped cream (plain)', 'dessert', 'CAUTION', 'Lactose/fat; tiny amounts only; not necessary nutritionally.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (76, 'butter', 'dairy', 'CAUTION', 'Very high fat; can cause pancreatitis; avoid.', '{merckvetmanual.com,akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (77, 'cream cheese (plain)', 'dairy', 'CAUTION', 'High fat; lactose; small amounts only if at all.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (78, 'olive oil (tiny amounts)', 'oil', 'CAUTION', 'High fat; a few drops may be okay; too much causes GI upset.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (79, 'coconut oil (tiny amounts)', 'oil', 'CAUTION', 'High fat; some dogs sensitive; tiny amounts only if at all.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (80, 'honey', 'sweetener', 'CAUTION', 'Sugar; tiny amounts only; avoid for diabetic/overweight dogs.', '{akc.org,merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (81, 'maple syrup', 'sweetener', 'CAUTION', 'Sugar; tiny amounts only; not recommended.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (82, 'molasses', 'sweetener', 'CAUTION', 'Sugar; tiny amounts only; sticky/choking risk.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (83, 'stevia (pure, tiny amounts)', 'sweetener', 'CAUTION', 'Non-nutritive sweetener; tiny amounts; avoid sweetened products with xylitol.', '{merckvetmanual.com,petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (84, 'erythritol', 'sweetener', 'CAUTION', 'Not xylitol; small amounts likely tolerated; avoid sweetened processed foods.', '{petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (85, 'tea (caffeinated)', 'beverage', 'UNSAFE', 'Caffeine toxicity risk; avoid all caffeinated tea.', '{merckvetmanual.com,petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (86, 'decaf tea (plain)', 'beverage', 'CAUTION', 'Small amounts likely okay; avoid additives; still not necessary.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (87, 'coffee (caffeinated/grounds/beans)', 'beverage', 'UNSAFE', 'Caffeine; grounds/beans dangerous; avoid entirely.', '{petpoisonhelpline.com,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (88, 'energy drinks', 'beverage', 'UNSAFE', 'Caffeine/other stimulants; never.', '{petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (89, 'alcohol (all types)', 'beverage', 'UNSAFE', 'Ethanol toxicity; never.', '{merckvetmanual.com,petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (90, 'raw yeast dough', 'other', 'UNSAFE', 'Expansion and ethanol production in stomach; life-threatening.', '{merckvetmanual.com,petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (91, 'nutmeg', 'spice', 'UNSAFE', 'Myristicin toxicity; never.', '{merckvetmanual.com,aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (92, 'cinnamon (tiny amounts)', 'spice', 'CAUTION', 'Tiny amounts only; large amounts irritate mouth/GI.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (93, 'turmeric (tiny amounts)', 'spice', 'CAUTION', 'Tiny culinary amounts may be okay; supplements require vet guidance.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (94, 'ginger (tiny amounts)', 'spice', 'CAUTION', 'Small culinary amounts; avoid strong/large doses.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (95, 'clove/allspice', 'spice', 'UNSAFE', 'Eugenol toxicity risk in quantity; avoid.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (96, 'salt (table salt)', 'seasoning', 'CAUTION', 'Excess salt can cause sodium ion poisoning; avoid salty snacks.', '{merckvetmanual.com,petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (97, 'black pepper', 'seasoning', 'CAUTION', 'Irritant; tiny sprinkles only if at all; not recommended.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (98, 'onion powder (seasoning)', 'seasoning', 'UNSAFE', 'Allium—concentrated; risk of hemolytic anemia.', '{merckvetmanual.com,aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (99, 'garlic powder (seasoning)', 'seasoning', 'UNSAFE', 'Allium—avoid in all forms.', '{merckvetmanual.com,aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (100, 'cooked turkey (plain, no skin/bones)', 'protein', 'SAFE', 'Plain cooked; remove skin/bones; avoid seasoning.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (101, 'lean beef (plain cooked)', 'protein', 'SAFE', 'Plain cooked; trim fat; small portions.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (102, 'pork (plain cooked, lean)', 'protein', 'CAUTION', 'Lean cooked pork in small portions; avoid seasoned/processed (ham, bacon).', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (103, 'lamb (plain cooked)', 'protein', 'CAUTION', 'Cooked plain; moderate fat; small amounts.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (104, 'salmon (cooked, no bones)', 'protein', 'SAFE', 'Cooked; remove bones/skin; avoid smoked/seasoned; no raw due to parasites.', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (105, 'tuna (plain, cooked, no oil)', 'protein', 'CAUTION', 'Fish mercury content; small amounts only; avoid oil/salt.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (106, 'sardines (plain, in water)', 'protein', 'CAUTION', 'Small fish; omega-3; choose no-salt added; small portions.', '{merckvetmanual.com,akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (107, 'whitefish/cod (cooked, plain)', 'protein', 'SAFE', 'Lean fish cooked plain; remove bones; small amounts.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (108, 'shrimp (cooked, plain)', 'protein', 'CAUTION', 'Cooked, shelled/deveined; small portions; avoid seasoning/butter.', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (109, 'egg (cooked, plain)', 'protein', 'SAFE', 'Cooked egg; avoid raw; small amounts.', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (110, 'raw egg', 'protein', 'UNSAFE', 'Risk of Salmonella/biotin deficiency; avoid.', '{merckvetmanual.com,akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (111, 'liver (cooked, small amounts)', 'organ meat', 'CAUTION', 'Vitamin A rich; small amounts only.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (112, 'giblets/organ meats (cooked, plain)', 'organ meat', 'CAUTION', 'Cooked plain; small amounts; rich; avoid seasoning.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (113, 'bone broth (plain, no onion/garlic)', 'other', 'CAUTION', 'Plain, defatted; **no onion/garlic**; small amounts.', '{merckvetmanual.com,akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (114, 'cooked bones', 'other', 'UNSAFE', 'Splintering/choking/obstruction risk; never feed cooked bones.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (115, 'raw bones (supervised, appropriate size)', 'other', 'CAUTION', 'Choking/dental fracture risk; only with vet guidance and supervision.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (116, 'rice (plain cooked)', 'grain', 'SAFE', 'Plain cooked; gentle on GI in moderation.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (117, 'brown rice (plain cooked)', 'grain', 'SAFE', 'Plain cooked; more fiber; introduce slowly.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (118, 'white rice (plain cooked)', 'grain', 'SAFE', 'Plain cooked; commonly used for bland diet with vet advice.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (119, 'pasta (plain cooked)', 'grain', 'CAUTION', 'Plain; small amounts; avoid sauces/seasonings.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (120, 'bread dough (raw)', 'other', 'UNSAFE', 'Yeast expansion & ethanol production; medical emergency.', '{petpoisonhelpline.com,merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (121, 'raisins in baked goods', 'dessert', 'UNSAFE', 'Raisins are toxic; avoid all forms/products containing raisins.', '{aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (122, 'grape jelly/juice', 'dessert', 'UNSAFE', 'Derived from grapes; avoid.', '{petpoisonhelpline.com,aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (123, 'cocoa powder/baking chocolate', 'dessert', 'UNSAFE', 'Highly concentrated theobromine/caffeine; most dangerous forms.', '{merckvetmanual.com,petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (124, 'milk chocolate candy', 'dessert', 'UNSAFE', 'Chocolate is toxic; milk chocolate still unsafe.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (125, 'dark chocolate/bar', 'dessert', 'UNSAFE', 'Higher theobromine; more dangerous than milk chocolate.', '{merckvetmanual.com,petpoisonhelpline.com,aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (126, 'xylitol (sweetener)', 'sweetener', 'UNSAFE', 'Powerful insulin release in dogs; causes hypoglycemia/liver failure.', '{petpoisonhelpline.com,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (127, 'sorbitol/maltitol (sugar alcohols)', 'sweetener', 'CAUTION', 'Can cause diarrhea/ GI upset; avoid in large amounts and processed foods.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (128, 'gravy/seasoned sauces', 'seasoning', 'CAUTION', 'Often contain onion/garlic/salt/fat; avoid.', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (129, 'ketchup/mustard/mayo', 'seasoning', 'CAUTION', 'Sugar/salt/spices; avoid feeding condiments.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (130, 'peppers—black/red flakes', 'seasoning', 'CAUTION', 'Irritants; not recommended.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (131, 'deli meats (processed)', 'protein', 'CAUTION', 'High salt/fat; preservatives; avoid or tiny amounts only.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (132, 'ham/bacon/sausage', 'protein', 'CAUTION', 'High salt/fat/seasonings; many guides advise avoiding.', '{merckvetmanual.com,petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (133, 'jerky (plain, no seasoning)', 'protein', 'CAUTION', 'Plain only; watch for salt/seasoning and quality; recalls happen.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (134, 'cheese (plain, small amounts)', 'dairy', 'CAUTION', 'Lactose/fat; small amounts; avoid blue/soft-ripened molds.', '{akc.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (135, 'blue cheese/roquefort', 'dairy', 'UNSAFE', 'Roquefortine C; tremorgenic mycotoxin risk—avoid.', '{petpoisonhelpline.com,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (136, 'goat cheese (plain)', 'dairy', 'CAUTION', 'Lactose/fat; small amounts only if tolerated.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (137, 'peanut (whole, shelled)', 'nut', 'CAUTION', 'Choking risk; high fat; safer as peanut butter (xylitol-free).', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (138, 'sesame seeds', 'seed', 'CAUTION', 'Tiny amounts ok; can appear in breads/crackers; watch fats.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (139, 'tahini (sesame paste)', 'seed', 'CAUTION', 'High fat; tiny amounts only; avoid garlic/lemon additives.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (140, 'broth powders/bouillon', 'seasoning', 'CAUTION', 'Often high sodium; may contain onion/garlic; avoid.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (141, 'soy sauce', 'seasoning', 'CAUTION', 'High sodium; avoid.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (142, 'vinegar (tiny amounts, diluted)', 'seasoning', 'CAUTION', 'Acidic; small amounts only, diluted; not necessary.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (143, 'tomato (ripe, red flesh only)', 'vegetable', 'CAUTION', 'Avoid green parts (solanine); ripe flesh small amounts okay.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (144, 'eggplant (cooked, small amounts)', 'vegetable', 'CAUTION', 'Nightshade; can cause GI upset; cooked small portions.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (145, 'okra (cooked, plain)', 'vegetable', 'CAUTION', 'Mucilaginous; small amounts; watch GI response.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (146, 'seaweed (plain nori)', 'other', 'CAUTION', 'Iodine content varies; tiny amounts only; avoid salted/seasoned snacks.', '{merckvetmanual.com,aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (147, 'raisins/trail mix products', 'dessert', 'UNSAFE', 'Any product containing raisins is unsafe.', '{petpoisonhelpline.com,aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (148, 'grape leaves/vines', 'other', 'UNSAFE', 'Grapes and related plant parts unsafe; avoid.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (149, 'poppy seeds', 'seed', 'CAUTION', 'Can cause false positives on drug tests; not needed for dogs; tiny amounts only.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (1, 'grape', 'fruit', 'UNSAFE', 'Toxic to dogs; can cause acute kidney injury. Avoid all forms (grapes, raisins/sultanas/currants), fresh or dried, seeded or seedless; even small amounts may be dangerous.', '{akc.org,aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 17:10:50.319165-05', '2025-11-07 19:26:10.403427-05');
INSERT INTO public.foods VALUES (2, 'raisin', 'fruit', 'UNSAFE', 'Same risk as grapes (toxic); dried form is more concentrated. Keep away from trail mix, breads, cookies, and cereals that contain raisins.', '{akc.org,aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 17:10:50.319165-05', '2025-11-07 19:26:10.403427-05');
INSERT INTO public.foods VALUES (3, 'chocolate', 'sweets', 'UNSAFE', 'Contains theobromine and caffeine (methylxanthines). Dark/baking chocolate and cocoa powder are highest risk; signs include vomiting, agitation, tachycardia, seizures. Never safe.', '{akc.org,aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 17:10:50.319165-05', '2025-11-07 19:26:10.403427-05');
INSERT INTO public.foods VALUES (4, 'apple', 'fruit', 'CAUTION', 'Flesh is generally safe in small pieces. Remove core, seeds, and stem (cyanogenic glycosides). No added sugar or seasoning; avoid choking hazards.', '{akc.org,aspca.org,merckvetmanual.com}', '2025-11-07 17:10:50.319165-05', '2025-11-07 19:26:10.403427-05');
INSERT INTO public.foods VALUES (5, 'chicken', 'protein', 'SAFE', 'Plain cooked chicken (boiled/baked) without skin, bones, or seasoning is safe. Avoid cooked bones (splinter risk) and onions/garlic, heavy oils, or sauces.', '{akc.org,aspca.org,merckvetmanual.com}', '2025-11-07 17:10:50.319165-05', '2025-11-07 19:26:10.403427-05');
INSERT INTO public.foods VALUES (150, 'water (plain)', 'beverage', 'SAFE', 'Essential for hydration; fresh, clean water should always be available.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (151, 'sparkling water (unflavored)', 'beverage', 'CAUTION', 'Small sips of plain sparkling water are unlikely to be harmful but carbonation may cause gas or bloating; avoid flavored or caffeinated varieties.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (152, 'sports drinks (electrolyte beverages)', 'beverage', 'CAUTION', 'Not formulated for dogs; high in sugar and salts; a few accidental licks are usually not toxic but they are not recommended as regular drinks.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (153, 'soda (regular soft drinks)', 'beverage', 'UNSAFE', 'High sugar and often caffeine; no nutritional benefit and risk of GI upset and caffeine toxicity.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (154, 'diet soda (sugar-free soft drinks)', 'beverage', 'UNSAFE', 'May contain caffeine and artificial sweeteners including xylitol; avoid entirely.', '{petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (155, 'flavored water with artificial sweeteners', 'beverage', 'UNSAFE', 'Sugar-free flavored waters may contain xylitol or other risky sweeteners; avoid.', '{petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (156, 'carrot (raw, plain)', 'vegetable', 'SAFE', 'Raw carrot sticks or coins are generally safe low-calorie treats when cut into bite-size pieces.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (157, 'blackberry', 'fruit', 'SAFE', 'Fresh blackberries are usually safe in small amounts; introduce slowly due to fiber.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (158, 'papaya (ripe, peeled, seeded)', 'fruit', 'SAFE', 'Ripe papaya flesh can be offered in small pieces; remove seeds and skin.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (159, 'honeydew melon (no rind/seeds)', 'fruit', 'SAFE', 'Seedless flesh only; remove rind and offer small pieces due to sugar content.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (160, 'dragon fruit (pitaya, peeled)', 'fruit', 'CAUTION', 'Small amounts of peeled dragon fruit flesh are likely tolerated but can cause GI upset; not nutritionally necessary.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (161, 'starfruit (carambola)', 'fruit', 'UNSAFE', 'Starfruit has been associated with kidney issues in some animals; best avoided for dogs.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (162, 'coconut flesh (fresh, unsweetened)', 'fruit', 'CAUTION', 'Small amounts of plain coconut flesh are usually tolerated but high fat can cause GI upset; avoid sweetened or large quantities.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (163, 'coconut water (unsweetened)', 'beverage', 'CAUTION', 'Contains potassium and sugars; small amounts may be okay but not a replacement for water.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (164, 'banana chips (unsweetened, baked)', 'fruit', 'CAUTION', 'Denser in calories and sometimes fried; only tiny amounts if unsweetened and unseasoned.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (165, 'dried cranberries (unsweetened)', 'fruit', 'CAUTION', 'Unsweetened dried cranberries in very small amounts may be tolerated but are concentrated in sugar and fiber; avoid sweetened mixes.', '{petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (166, 'applesauce (plain, unsweetened)', 'fruit', 'CAUTION', 'Plain unsweetened applesauce in small spoonfuls is often tolerated; avoid added sugar/xylitol and any with grape or raisin ingredients.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (167, 'persimmon (ripe flesh only)', 'fruit', 'CAUTION', 'Seeds and pit can cause intestinal problems; small amounts of ripe flesh only if given at all.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (168, 'romaine lettuce', 'vegetable', 'SAFE', 'Plain romaine leaves are low-calorie and generally safe in small amounts.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (169, 'iceberg lettuce', 'vegetable', 'CAUTION', 'Mostly water and fiber with little nutrition; small amounts usually safe but can cause loose stool in some dogs.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (170, 'green cabbage (cooked, plain)', 'vegetable', 'CAUTION', 'Cooked plain cabbage in small amounts may be tolerated but can cause gas and GI upset.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (171, 'brussels sprouts (cooked, plain)', 'vegetable', 'CAUTION', 'Cooked brussels sprouts are fibrous and can cause gas; only small portions if at all.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (172, 'butternut squash (cooked, plain)', 'vegetable', 'SAFE', 'Cooked plain squash without seeds or skin can be a fiber-rich treat in moderation.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (173, 'acorn squash (cooked, plain)', 'vegetable', 'CAUTION', 'Cooked, peeled, seedless acorn squash may be okay in small amounts; high in fiber and starch.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (174, 'turnip (cooked, plain)', 'vegetable', 'CAUTION', 'Cooked plain turnip in small amounts may be tolerated; too much can cause GI upset.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (175, 'parsnip (cooked, plain)', 'vegetable', 'CAUTION', 'Cooked plain parsnip can be used as an occasional treat; monitor for GI changes.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (176, 'radish (raw, plain)', 'vegetable', 'CAUTION', 'Peppery flavor and fiber can cause GI upset; small amounts at most.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (177, 'corn on the cob (whole cob)', 'vegetable', 'UNSAFE', 'Corn cob pieces are a major obstruction risk even though kernels are not; never allow dogs to chew on or eat cobs.', '{petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (178, 'coleslaw (with dressing)', 'vegetable', 'CAUTION', 'Often contains mayonnaise, sugar, vinegar, onion, or other seasonings; not recommended and can cause GI upset.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (179, 'macadamia nuts', 'nut', 'UNSAFE', 'Even small amounts can cause weakness, tremors, and hyperthermia in dogs; avoid entirely.', '{aspca.org,petpoisonhelpline.com,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (180, 'pine nuts', 'nut', 'CAUTION', 'High in fat and calories; tiny amounts only if at all; risk of GI upset and pancreatitis with larger servings.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (181, 'hemp seeds (plain, shelled)', 'seed', 'CAUTION', 'Plain shelled hemp seeds in tiny amounts are often tolerated but high in fat; avoid flavored or CBD-added products without veterinary guidance.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (182, 'psyllium husk', 'fiber supplement', 'CAUTION', 'Used as a fiber supplement under veterinary guidance; excessive amounts can cause GI obstruction or discomfort.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (183, 'herbal tea (caffeine-free, plain)', 'beverage', 'CAUTION', 'Many plain caffeine-free herbal teas are likely low risk in small amounts, but some herbs can be problematic; water is preferred.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (184, 'hot chocolate drink', 'beverage', 'UNSAFE', 'Contains chocolate and often sugar and milk; risk of theobromine and caffeine toxicity plus GI upset.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (185, 'chocolate syrup', 'dessert', 'UNSAFE', 'Concentrated chocolate and sugar; even small amounts can be dangerous depending on dose and dog size.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (186, 'caramel sauce', 'dessert', 'CAUTION', 'Very high in sugar and sometimes fat; not toxic like chocolate but should generally be avoided.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (187, 'granulated sugar', 'sweetener', 'CAUTION', 'Sugar itself is not a specific toxin but contributes to obesity and dental disease; avoid intentional feeding.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (188, 'brown sugar', 'sweetener', 'CAUTION', 'Similar to white sugar; not directly toxic but unhealthy and unnecessary for dogs.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (189, 'powdered sugar', 'sweetener', 'CAUTION', 'Finely ground sugar; unhealthy and can easily coat treats in large amounts; avoid feeding.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (190, 'corn syrup', 'sweetener', 'CAUTION', 'High in simple sugars; not recommended for routine use except under specific veterinary instructions (for hypoglycemia emergencies).', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (191, 'agave syrup', 'sweetener', 'CAUTION', 'High fructose sweetener with no benefit for dogs; avoid regular feeding.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (192, 'gummy bears and gummy candy', 'dessert', 'UNSAFE', 'Very high in sugar and may contain xylitol or other additives; not formulated for dogs and should be avoided.', '{petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (193, 'fruit snacks (gummy-style)', 'dessert', 'CAUTION', 'Often high in sugar and sometimes contain grape juice or xylitol; avoid intentional feeding and read ingredient labels carefully.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (194, 'marshmallows (regular, non-xylitol)', 'dessert', 'CAUTION', 'Standard marshmallows are mostly sugar; small accidental pieces are usually not toxic but they are not a good treat choice.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (195, 'marshmallows (sugar-free, xylitol-containing)', 'dessert', 'UNSAFE', 'Sugar-free marshmallows may contain xylitol and can cause life-threatening hypoglycemia and liver failure.', '{petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (196, 'hard candy (non-chocolate)', 'dessert', 'CAUTION', 'High sugar and choking hazard; some sugar-free varieties contain xylitol; avoid as treats.', '{petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (197, 'lollipops', 'dessert', 'CAUTION', 'Similar risks as hard candy plus stick ingestion hazard; keep away from dogs.', '{petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (198, 'jelly beans', 'dessert', 'CAUTION', 'Sugar, artificial colors, and potential xylitol; not recommended and some may be dangerous depending on ingredients.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (199, 'cotton candy', 'dessert', 'CAUTION', 'Pure sugar with no nutritional value; can contribute to GI upset and obesity; avoid.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (200, 'plain donuts (no chocolate)', 'dessert', 'CAUTION', 'Fried dough high in fat and sugar; can contribute to pancreatitis and obesity; avoid feeding.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (201, 'frosted cake (vanilla, no chocolate)', 'dessert', 'CAUTION', 'Very high in sugar and fat; some frostings contain xylitol; not recommended for dogs.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (202, 'cupcakes (no chocolate)', 'dessert', 'CAUTION', 'Similar to cake; high sugar/fat and often decorated with unsafe ingredients; avoid routine feeding.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (203, 'brownies (no nuts)', 'dessert', 'UNSAFE', 'Contain chocolate which is toxic to dogs; even small amounts can be dangerous depending on chocolate type and dose.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (204, 'sugar cookies', 'dessert', 'CAUTION', 'High in sugar and fat; not toxic like chocolate but unhealthy and unnecessary for dogs.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (205, 'chocolate chip cookies', 'dessert', 'UNSAFE', 'Contain chocolate plus sugar and fat; toxicity risk from chocolate chips.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (206, 'ice pops/popsicles (no xylitol, no grapes)', 'dessert', 'CAUTION', 'Many are high in sugar and artificial flavors; small licks of a plain, dog-safe flavor may be tolerated but not recommended as regular treats.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (207, 'gelatin dessert (plain, no xylitol)', 'dessert', 'CAUTION', 'Plain gelatin without xylitol or grapes in small amounts is usually tolerated; avoid sugar-free or fruit-cocktail varieties with unsafe fruits.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (208, 'vanilla pudding (no xylitol)', 'dessert', 'CAUTION', 'Contains dairy and sugar; may cause GI upset; avoid sugar-free products with xylitol.', '{petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (209, 'breakfast cereal (unsweetened, plain)', 'grain', 'CAUTION', 'Plain unsweetened cereals like simple oat or corn flakes may be tolerated in small amounts but provide little benefit; avoid those with raisins or chocolate.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (210, 'breakfast cereal (sweetened)', 'grain', 'CAUTION', 'High sugar and sometimes chocolate or marshmallows; avoid feeding and check for xylitol or raisins.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (211, 'granola bars', 'snack', 'CAUTION', 'Often contain raisins, chocolate, nuts, or xylitol; many are unsafe; avoid unless ingredients are carefully checked and dog-safe.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (212, 'protein/energy bars', 'snack', 'UNSAFE', 'Frequently contain chocolate, raisins, xylitol, or high protein loads; considered high-risk human food for dogs.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (213, 'potato chips (plain, salted)', 'snack', 'CAUTION', 'High in fat and salt; small accidental pieces are usually not toxic but chips should not be used as treats.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (214, 'tortilla chips', 'snack', 'CAUTION', 'High in salt and often flavored; small amounts may not be toxic but can contribute to GI upset and obesity.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (215, 'french fries', 'snack', 'CAUTION', 'Deep-fried potatoes with salt and sometimes seasonings; high fat and sodium; avoid feeding intentionally.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (216, 'onion rings', 'snack', 'UNSAFE', 'Combine onion (toxic to red blood cells) with batter and frying; avoid completely.', '{aspca.org,petpoisonhelpline.com,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (217, 'pizza (cheese and toppings)', 'fast food', 'CAUTION', 'High in fat, salt, and often contains onion, garlic, or processed meats; small accidental bites are usually not toxic but pizza is not an appropriate treat.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (218, 'hamburger (plain patty, no bun or seasoning)', 'protein', 'CAUTION', 'Plain cooked lean beef patty in small pieces can be tolerated but many burgers are seasoned or cooked with onion/garlic and extra fat.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (219, 'fast-food hamburger with bun and toppings', 'fast food', 'CAUTION', 'Often includes cheese, sauces, pickles, onion, and high salt; not recommended for dogs.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (220, 'hot dog (processed sausage)', 'protein', 'CAUTION', 'Very high in salt and fat with preservatives; tiny pieces may be used as high-value training treats but regular feeding is not advised.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (221, 'chicken nuggets (breaded, fried)', 'fast food', 'CAUTION', 'Breaded and fried with seasoning and often dipping sauces; high in fat and sodium; avoid as a regular treat.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (222, 'rotisserie chicken (store-bought, seasoned)', 'protein', 'CAUTION', 'Seasoned skin and drippings can be very fatty and may contain onion or garlic; remove skin and bones if a small amount of plain meat is used.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (223, 'bacon grease/drippings', 'oil', 'UNSAFE', 'Extremely high in fat; strong risk for pancreatitis and GI upset even in small amounts.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (224, 'canned tuna in oil (human)', 'protein', 'CAUTION', 'High in fat and sometimes salt; small amounts infrequently may be tolerated but water-packed tuna is preferred and mercury limits should be considered.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (225, 'canned salmon with bones', 'protein', 'CAUTION', 'Soft canned bones are usually edible for humans but may still pose risk for dogs; high in fat and salt; small amounts only if bones are crushed.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (226, 'beef jerky (human, seasoned)', 'protein', 'CAUTION', 'Often very salty and seasoned with onion/garlic powder; some brands may contain sugar or unsafe additives; avoid unless ingredients are verified dog-safe.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (227, 'raw fish (sushi-grade, no seasoning)', 'protein', 'CAUTION', 'Raw fish can carry parasites and bacteria; generally not recommended unless under veterinary guidance.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (228, 'raw meat (ground beef, chicken, pork)', 'protein', 'CAUTION', 'Raw meat diets carry bacterial and parasitic risks; should only be fed if balanced and handled under veterinary supervision.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (229, 'raw liver', 'organ meat', 'CAUTION', 'Very high in vitamin A and can cause toxicity if fed in excess; raw also has infectious risks; only small amounts under veterinary guidance.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (230, 'basil (fresh leaves)', 'herb', 'CAUTION', 'Small amounts of fresh basil used as seasoning are generally low risk but not necessary; avoid concentrated essential oils.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (231, 'parsley (fresh leaves, curly)', 'herb', 'CAUTION', 'Small sprigs are often used as garnish and are usually safe; large amounts or certain varieties may cause issues; avoid seeds and essential oils.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (232, 'rosemary (fresh or dried)', 'herb', 'CAUTION', 'Culinary amounts are typically low risk but can cause GI upset; avoid concentrated extracts or oils without vet advice.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (233, 'oregano (dried)', 'spice', 'CAUTION', 'Small culinary amounts are usually tolerated but can irritate the GI tract in larger doses; essential oil is more concerning.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (234, 'thyme (dried)', 'spice', 'CAUTION', 'Cooking-level amounts are generally low risk but can cause GI upset if overused; avoid essential oil forms.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (235, 'cilantro (fresh leaves)', 'herb', 'CAUTION', 'Fresh cilantro leaves in small amounts are usually tolerated, but some dogs may dislike the strong flavor; not necessary nutritionally.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (236, 'dill (fresh leaves)', 'herb', 'CAUTION', 'Small amounts as a culinary herb are typically low risk, but large amounts or concentrated products can cause GI upset.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (237, 'mint leaves (fresh)', 'herb', 'CAUTION', 'Some mints are safe in tiny amounts while others may not be; large amounts may upset the stomach; avoid xylitol-containing mint candies or gums entirely.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (238, 'paprika (ground spice)', 'spice', 'CAUTION', 'Made from peppers; can irritate mouth and GI tract; avoid intentionally seasoning dog food with paprika.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (239, 'curry powder', 'spice', 'CAUTION', 'Mixture may contain onion, garlic, and hot spices; should not be given to dogs.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (240, 'salad dressing (ranch or creamy)', 'seasoning', 'CAUTION', 'High in fat and often contains onion, garlic, and salt; not appropriate for dogs.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (241, 'hot sauce', 'seasoning', 'UNSAFE', 'Contains hot peppers, vinegar, and salt; can cause significant oral and GI irritation.', '{petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (242, 'salsa (mild, tomato-based)', 'seasoning', 'CAUTION', 'Often contains onion, garlic, salt, and acidic ingredients; even mild salsa is not recommended for dogs.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (243, 'potato salad (with mayonnaise)', 'salad', 'CAUTION', 'Typically contains mayonnaise, mustard, onions, and seasonings; high fat and potential toxins; avoid.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (244, 'egg salad', 'salad', 'CAUTION', 'Made with mayonnaise and seasonings; high in fat and often includes onion or other risky ingredients; avoid.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (245, 'tuna salad', 'salad', 'CAUTION', 'Contains mayonnaise and seasonings plus tuna; can be very fatty and salty and may include onion or relish; not suitable for dogs.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (246, 'baby carrots (raw, plain)', 'vegetable', 'SAFE', 'Washed baby carrots are similar to regular carrots; crunch makes them popular low-calorie treats when fed in moderation.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (247, 'canned pumpkin pie filling', 'dessert', 'CAUTION', 'Unlike plain pumpkin, pie filling often contains sugar and spices like nutmeg and clove; do not confuse with plain canned pumpkin.', '{petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (248, 'spoiled or moldy human food', 'other', 'UNSAFE', 'Mold toxins and bacterial overgrowth can cause serious illness including tremors, seizures, and GI disease; discard rather than feed.', '{petpoisonhelpline.com,aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (249, 'leftover table scraps (mixed foods)', 'other', 'CAUTION', 'Mixed human leftovers often contain fat, salt, bones, onions, garlic, or other unsafe items; best avoided as a routine feeding practice.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (250, 'lactose-free cow milk (plain)', 'dairy', 'CAUTION', 'Reduced lactose but still dairy; offer only small amounts and monitor for GI upset.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (251, 'almond milk (unsweetened)', 'dairy alternative', 'CAUTION', 'Made from almonds which are high in fat; often contains additives; not toxic in tiny amounts but not recommended as a regular drink.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (252, 'soy milk (unsweetened)', 'dairy alternative', 'CAUTION', 'Contains soy protein and possible additives; small quantities may be tolerated but not necessary and may cause GI upset or allergies.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (253, 'oat milk (unsweetened)', 'dairy alternative', 'CAUTION', 'Carbohydrate-rich plant milk; small amounts likely tolerated but adds calories without real benefit.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (254, 'rice milk (unsweetened)', 'dairy alternative', 'CAUTION', 'Thin, carb-heavy drink; usually safe in small sips but not a substitute for water and offers little nutrition for dogs.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (255, 'coconut milk (canned, unsweetened)', 'dairy alternative', 'CAUTION', 'Very high in fat; small amounts may be tolerated but can trigger diarrhea or pancreatitis in some dogs.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (256, 'evaporated milk (unsweetened)', 'dairy', 'CAUTION', 'Concentrated cow milk; higher lactose and fat per volume; only tiny amounts if used at all.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (257, 'sweetened condensed milk', 'dairy', 'CAUTION', 'Very high in sugar and lactose; can cause GI upset and contribute to obesity; avoid as a treat.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (258, 'frozen yogurt (vanilla, no xylitol)', 'dessert', 'CAUTION', 'Contains dairy and sugar; small licks of plain vanilla may be tolerated but regular feeding is not recommended.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (259, 'fruit juice blend (no grape)', 'beverage', 'CAUTION', 'High in natural and sometimes added sugars; a few sips of non-grape juice are usually not toxic but water is preferred.', '{akc.org,healthline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (260, 'orange juice (no pulp)', 'beverage', 'CAUTION', 'Acidic and sugary; can cause stomach upset; not needed in the diet.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (261, 'apple juice (no grape, no xylitol)', 'beverage', 'CAUTION', 'Filtered juice is high in sugar without fiber; small amounts may be tolerated but not recommended routinely.', '{healthline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (262, 'smoothie (fruit and yogurt)', 'beverage', 'CAUTION', 'Often contains dairy, lots of sugar, and sometimes unsafe ingredients; only safe if all ingredients are dog-friendly and portion is tiny.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (263, 'flavored coffee creamer (nondairy)', 'other', 'CAUTION', 'High in sugar and fat; sugar-free versions may contain xylitol; read labels carefully and avoid as a dog treat.', '{petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (264, 'baking soda (sodium bicarbonate)', 'other', 'UNSAFE', 'Ingesting significant amounts can cause metabolic and electrolyte disturbances; not a food for dogs.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (265, 'baking powder', 'other', 'UNSAFE', 'Contains baking soda and acids; ingestion of batter or large amounts can lead to serious electrolyte imbalances.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (266, 'vanilla extract (alcohol based)', 'flavoring', 'UNSAFE', 'High alcohol content; ingestion of even small volumes can contribute to ethanol toxicity.', '{aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (267, 'almond extract', 'flavoring', 'UNSAFE', 'Typically alcohol based and very concentrated; not appropriate for dogs and may cause ethanol-related issues.', '{aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (268, 'cream of tartar', 'other', 'CAUTION', 'Potassium bitartrate; a small amount in baked goods is unlikely to cause harm but concentrated ingestion can upset electrolyte balance.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (269, 'cornstarch', 'other', 'CAUTION', 'Pure starch; small quantities as a thickener in otherwise dog-safe recipes are usually tolerated but offer no real nutrition.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (270, 'all-purpose white flour', 'grain', 'CAUTION', 'Refined carbohydrate; safe as part of properly baked dog treats but not beneficial on its own.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (271, 'whole wheat flour', 'grain', 'CAUTION', 'Higher fiber than white flour; can be used in small amounts for homemade treats if dog tolerates gluten.', '{akc.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (272, 'almond flour', 'nut', 'CAUTION', 'Made from ground almonds; high in fat and calories; use only in tiny amounts if at all.', '{goodrx.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (273, 'coconut flour', 'other', 'CAUTION', 'High fiber flour; can cause loose stools if fed in more than very small amounts.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (274, 'rice flour', 'grain', 'CAUTION', 'Gluten-free flour used in some hypoallergenic treats; generally tolerated in moderation.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (275, 'cornmeal (dry)', 'grain', 'CAUTION', 'Ground corn; safe in small amounts in cooked treats but can contribute to calorie load and GI upset in excess.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (276, 'seitan (cooked wheat gluten)', 'protein', 'CAUTION', 'Very high in gluten protein; some dogs may tolerate tiny amounts but it is not a typical or necessary dog food.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (277, 'tempeh (cooked, plain)', 'protein', 'CAUTION', 'Fermented soy product; a small amount of plain tempeh may be tolerated but soy can cause GI upset or allergies in some dogs.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (278, 'hummus (with garlic)', 'spread', 'UNSAFE', 'Typically contains garlic, lemon, salt, and oil; garlic is toxic to dogs and high fat can cause GI upset.', '{aspca.org,goodrx.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (279, 'guacamole dip (with onion/garlic)', 'spread', 'UNSAFE', 'Prepared guacamole often includes onion and garlic plus fatty ingredients; those allium ingredients are toxic to dogs.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (280, 'dill pickles (brined)', 'vegetable', 'CAUTION', 'High in sodium and sometimes garlic or onion; small tastes may not be toxic but pickles are not recommended treats.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (281, 'sweet pickles', 'vegetable', 'CAUTION', 'Contain sugar and often high salt; not toxic in tiny bites but best avoided.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (282, 'green olives (pitted)', 'fruit', 'CAUTION', 'Plain, pitted olives in small numbers are usually tolerated but they are salty and oily; avoid stuffed or seasoned varieties.', '{akc.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (283, 'black olives (pitted)', 'fruit', 'CAUTION', 'Similar to green olives; small amounts may be safe but high salt and fat make them poor choices.', '{akc.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (284, 'sauerkraut', 'vegetable', 'CAUTION', 'Fermented cabbage with lots of salt; a small forkful is unlikely to be toxic but can upset the stomach.', '{goodrx.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (285, 'kimchi (spicy fermented cabbage)', 'vegetable', 'UNSAFE', 'Usually contains chili, garlic, onion, and high salt; these ingredients can be harmful to dogs.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (286, 'instant ramen noodles with seasoning', 'fast food', 'CAUTION', 'Seasoning packets are very salty and may contain onion or garlic; not recommended, especially with broth.', '{goodrx.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (287, 'instant ramen noodles without seasoning', 'grain', 'CAUTION', 'Plain cooked noodles without packet are less risky but offer little nutrition and add empty calories.', '{goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (288, 'spaghetti with tomato meat sauce', 'fast food', 'CAUTION', 'Typical sauces contain onion, garlic, salt, and fat; small accidental amounts may be tolerated but it is not dog-safe food.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (289, 'lasagna with cheese and meat', 'fast food', 'CAUTION', 'Rich in cheese, meat, fat, and seasonings like onion and garlic; can cause GI upset and pancreatitis.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (290, 'garlic bread', 'fast food', 'UNSAFE', 'Bread coated in garlic-containing butter or oil; garlic is toxic to red blood cells in dogs.', '{aspca.org,merckvetmanual.com,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (291, 'banana bread (no raisins)', 'dessert', 'CAUTION', 'Sweet, fatty loaf; not toxic if free of raisins and chocolate but adds sugar and fat without benefit.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (292, 'bagel (plain)', 'grain', 'CAUTION', 'Dense refined bread; small pieces are usually safe but high in carbohydrates and calories.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (293, 'croissant (butter)', 'grain', 'CAUTION', 'Buttery, high-fat pastry; can contribute to GI upset and pancreatitis; avoid as a treat.', '{goodrx.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (294, 'pancake (plain)', 'grain', 'CAUTION', 'Plain pancake without syrup or toppings is not toxic but is sugary, starchy, and not necessary.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (295, 'waffle (plain)', 'grain', 'CAUTION', 'Similar to pancakes; small bites usually safe but offer little nutrition and lots of starch.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (296, 'pretzels (hard, salted)', 'snack', 'CAUTION', 'High in salt and refined carbs; a few pieces are seldom toxic but salty snacks are on lists of foods to avoid.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (297, 'rice cakes (plain)', 'snack', 'CAUTION', 'Low-fat but mostly air and starch; not harmful in tiny pieces but no real benefit.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (298, 'Snickers chocolate bar', 'dessert', 'UNSAFE', 'Contains milk chocolate plus nougat, caramel, and peanuts; chocolate is toxic to dogs.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (299, 'Twix chocolate cookie bar', 'dessert', 'UNSAFE', 'Cookie bar coated in milk chocolate with caramel; chocolate content makes it unsafe for dogs.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (300, 'KitKat chocolate wafer bar', 'dessert', 'UNSAFE', 'Wafer bar covered in chocolate; any chocolate candy bar should be kept away from dogs.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (301, 'Milky Way chocolate bar', 'dessert', 'UNSAFE', 'Chocolate-coated nougat and caramel; the chocolate content poses toxicity risks.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (302, '3 Musketeers chocolate bar', 'dessert', 'UNSAFE', 'Fluffy nougat covered in milk chocolate; chocolate is the key concern for dogs.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (303, 'Butterfinger chocolate bar', 'dessert', 'UNSAFE', 'Peanut-flavored crisp coated in chocolate; chocolate plus high fat make it unsafe.', '{merckvetmanual.com,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (304, 'Baby Ruth chocolate bar', 'dessert', 'UNSAFE', 'Chocolate, peanuts, and caramel; chocolate toxicity and fat content are major concerns.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (305, 'Mars chocolate bar', 'dessert', 'UNSAFE', 'Chocolate bar with caramel and nougat; follows general rule that chocolate candy bars are not safe for dogs.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (306, 'Reeses peanut butter cups', 'dessert', 'UNSAFE', 'Combination of chocolate and sweetened peanut butter; chocolate makes this unsafe.', '{merckvetmanual.com,aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (307, 'M&Ms milk chocolate candies', 'dessert', 'UNSAFE', 'Small candy-coated pieces of milk chocolate; size makes them easy for dogs to eat dangerous amounts.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (308, 'M&Ms peanut candies', 'dessert', 'UNSAFE', 'Peanuts inside milk chocolate; chocolate toxicity plus fat from nuts.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (309, 'Hersheys milk chocolate bar', 'dessert', 'UNSAFE', 'Plain milk chocolate bar; chocolate is listed among foods dogs should never eat.', '{merckvetmanual.com,aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (310, 'Hersheys Kisses milk chocolate', 'dessert', 'UNSAFE', 'Small individually wrapped milk chocolates; easy for dogs to ingest wrappers and chocolate.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (311, 'Nestle Crunch chocolate bar', 'dessert', 'UNSAFE', 'Milk chocolate with crisped rice; chocolate content is unsafe for dogs.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (312, 'Toblerone chocolate bar', 'dessert', 'UNSAFE', 'Triangular milk chocolate with nougat; chocolate makes it inappropriate for dogs.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (313, 'York peppermint patties', 'dessert', 'UNSAFE', 'Peppermint fondant coated in dark chocolate; dark chocolate is especially dangerous.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (314, 'Skittles fruit candy', 'dessert', 'CAUTION', 'High sugar candy with artificial colors; not toxic like chocolate but unhealthy and may cause GI upset.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (315, 'Starburst fruit chews', 'dessert', 'CAUTION', 'Chewy, sugary candies; no chocolate but lots of sugar and potential choking risk.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (316, 'Sour Patch Kids candy', 'dessert', 'CAUTION', 'Sour sugar-coated gummies; acidic and sugary; not recommended, though not typically poisonous.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (317, 'Swedish Fish candy', 'dessert', 'CAUTION', 'Non-chocolate gummy candy; high sugar, no nutritional value, and possible GI upset.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (318, 'Jolly Rancher hard candy', 'dessert', 'CAUTION', 'Hard candy that is a choking hazard and full of sugar; some flavors may be sugar-free with xylitol.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (319, 'Life Savers hard candy', 'dessert', 'CAUTION', 'Ring-shaped hard candies; choking risk and sugar load; sugar-free versions may contain xylitol.', '{petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (320, 'Nerds candy', 'dessert', 'CAUTION', 'Tiny, crunchy, very sugary candy; may cause GI upset but not typically toxic unless sugar-free with xylitol.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (321, 'Airheads taffy candy', 'dessert', 'CAUTION', 'Stretchy taffy with high sugar and artificial flavors; not toxic but not appropriate dog treats.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (322, 'Twizzlers licorice twists', 'dessert', 'CAUTION', 'Red licorice-style candy; high in sugar; not true licorice root but still unhealthy and a choking risk.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (323, 'Red Vines licorice twists', 'dessert', 'CAUTION', 'Similar to Twizzlers; sugary treat without chocolate but not suitable for dogs.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (324, 'Trident sugarfree gum', 'dessert', 'UNSAFE', 'Many sugarless gums including some Trident flavors contain xylitol, which is highly toxic to dogs.', '{petpoisonhelpline.com,vcahospitals.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (325, 'Orbit sugarfree gum', 'dessert', 'UNSAFE', 'Sugar-free gums like Orbit often use xylitol as a sweetener; ingestion can cause severe hypoglycemia and liver failure.', '{petpoisonhelpline.com,vcahospitals.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (326, 'Extra sugarfree gum', 'dessert', 'UNSAFE', 'Sugar-free gums are a common xylitol source; even a few pieces can be dangerous to dogs.', '{petpoisonhelpline.com,vcahospitals.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (327, 'Ice Breakers Ice Cubes gum', 'dessert', 'UNSAFE', 'Some Ice Breakers gums are listed among sugarless gums containing xylitol; avoid completely.', '{petpoisonhelpline.com,vcahospitals.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (328, 'Ice Breakers mints', 'dessert', 'UNSAFE', 'Sugar-free mints may contain xylitol; any xylitol-containing candy is dangerous for dogs.', '{petpoisonhelpline.com,aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (329, 'Mentos mints (sugar type)', 'dessert', 'CAUTION', 'Chewy or hard mints; sugary and potential choking hazard; sugar-free varieties may contain xylitol.', '{petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (330, 'Tic Tac mints', 'dessert', 'CAUTION', 'Small breath mints that are mostly sugar; not ideal treats and could pose choking risk.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (331, 'Oreo sandwich cookies', 'dessert', 'CAUTION', 'Chocolate-flavored cookies with creme; cocoa content is relatively low but they are sugary and fatty; avoid feeding.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (332, 'Chips Ahoy chocolate chip cookies', 'dessert', 'UNSAFE', 'Contain chocolate chips plus lots of sugar and fat; chocolate inclusion makes them unsafe.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (333, 'Nutter Butter peanut butter cookies', 'dessert', 'CAUTION', 'Sweet peanut butter cookies without chocolate; high in sugar and fat; not toxic but not recommended.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (334, 'Fig Newtons cookies', 'dessert', 'CAUTION', 'Fig-filled cookies are sugary and may cause GI upset; avoid as routine treats.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (335, 'Pop-Tarts toaster pastries', 'breakfast', 'CAUTION', 'Frosted pastries high in sugar and fat; many flavors contain chocolate or unsafe fillings; generally not dog-safe.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (336, 'Eggo frozen waffles', 'breakfast', 'CAUTION', 'Processed waffles with added sugar and salt; small pieces of plain waffles may not be toxic but not ideal food for dogs.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (337, 'Nutri-Grain breakfast bars', 'snack', 'CAUTION', 'Soft bars with fruit fillings; may contain sugar, raisins, or other ingredients that can be problematic; check labels.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (338, 'Kelloggs Corn Flakes cereal', 'grain', 'CAUTION', 'Plain corn flakes are low in sugar but still refined carbs; small pieces may be used as occasional treats.', '{akc.org,healthline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (339, 'Cheerios cereal (plain)', 'grain', 'CAUTION', 'Many vets use plain Cheerios as training treats in tiny amounts; safe in moderation but nutritionally limited.', '{akc.org,healthline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (340, 'Froot Loops cereal', 'grain', 'CAUTION', 'Colorful sweetened cereal; high in sugar and artificial colors; not toxic but not recommended.', '{aspca.org,healthline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (341, 'Lucky Charms cereal', 'grain', 'CAUTION', 'Sweet cereal with marshmallows; very high in sugar; avoid giving to dogs.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (342, 'Doritos Nacho Cheese chips', 'snack', 'CAUTION', 'Corn chips with cheese powder and spices; high salt and fat, may contain onion/garlic powder.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (343, 'Cheetos crunchy snacks', 'snack', 'CAUTION', 'Cheese-flavored corn snacks; salty and fatty; a few pieces are rarely toxic but should not be used as treats.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (344, 'Pringles Original chips', 'snack', 'CAUTION', 'Stacked potato crisps with salt and fat; salty snacks are among foods to avoid feeding dogs.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (345, 'Takis Fuego rolled chips', 'snack', 'CAUTION', 'Very spicy, salty chips; the chili and acidity can irritate the GI tract.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (346, 'Goldfish cheddar crackers', 'snack', 'CAUTION', 'Cheese-flavored crackers; high in salt and refined carbs; small amounts occasionally are often tolerated but not ideal.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (347, 'Cheez-It crackers', 'snack', 'CAUTION', 'Baked cheese crackers; salty and calorie-dense; better avoided.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (348, 'Ritz crackers', 'snack', 'CAUTION', 'Buttery salted crackers; small pieces rarely cause toxicity but provide little nutrition and extra fat.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (349, 'Wheat Thins crackers', 'snack', 'CAUTION', 'Whole grain crackers that are still salty and processed; not toxic but not appropriate treats.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (350, 'Triscuit crackers', 'snack', 'CAUTION', 'Shredded wheat crackers with salt and oil; a small piece may be tolerated but high fiber and salt can upset the stomach.', '{aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (351, 'SunChips multigrain chips', 'snack', 'CAUTION', 'Multigrain but still salty and oily; better avoided as dog treats.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (352, 'Coca-Cola soda', 'beverage', 'UNSAFE', 'Caffeinated, sugary soft drink; caffeine is toxic and sugar adds no benefit.', '{merckvetmanual.com,aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (353, 'Pepsi soda', 'beverage', 'UNSAFE', 'Similar to other colas; contains caffeine and sugar which are on lists of foods dogs should not eat.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (354, 'Sprite soda', 'beverage', 'CAUTION', 'Lemon-lime soda without caffeine but high in sugar and acidity; not recommended.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (355, 'Mountain Dew soda', 'beverage', 'UNSAFE', 'Citrus soda with high caffeine and sugar; stimulants and sugar make it unsafe.', '{merckvetmanual.com,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (356, 'Dr Pepper soda', 'beverage', 'UNSAFE', 'Caffeinated soft drink; caffeine is toxic to dogs and sugary drinks are on do-not-feed lists.', '{merckvetmanual.com,aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (357, 'Gatorade sports drink', 'beverage', 'CAUTION', 'Electrolyte drink with salts and sugar; small amounts may be used under vet guidance but water is preferred.', '{aspca.org,healthline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (358, 'Powerade sports drink', 'beverage', 'CAUTION', 'Similar to other sports drinks; can add unnecessary sugar and sodium; not intended for dogs.', '{aspca.org,healthline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (359, 'Red Bull energy drink', 'beverage', 'UNSAFE', 'Energy drinks are high in caffeine and other stimulants; even small amounts can be dangerous.', '{merckvetmanual.com,goodrx.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (360, 'Monster Energy drink', 'beverage', 'UNSAFE', 'Large volumes of caffeine and stimulants; should never be given to dogs.', '{merckvetmanual.com,goodrx.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (361, 'McDonalds French fries', 'fast food', 'CAUTION', 'Deep-fried potatoes with salt; fatty and salty foods are on the list of items to avoid for dogs.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (362, 'McDonalds Big Mac sandwich', 'fast food', 'CAUTION', 'Burger with sauce, cheese, and pickles; high in fat, salt, and often onion-containing condiments.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (363, 'McDonalds Chicken McNuggets', 'fast food', 'CAUTION', 'Breaded and fried chicken pieces; high fat and salt; occasional tiny piece of plain meat only if breading and sauces are removed.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (364, 'Burger King Whopper sandwich', 'fast food', 'CAUTION', 'Large burger with toppings; contains fat, salt, and likely onion; not dog-appropriate food.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (365, 'KFC fried chicken (original recipe)', 'fast food', 'CAUTION', 'Fried chicken with breading and seasoning; very fatty and may contain garlic or onion; bones are especially dangerous.', '{aspca.org,goodrx.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (366, 'Taco Bell beef burrito', 'fast food', 'CAUTION', 'Seasoned beef, cheese, and tortillas; spices, salt, and possible onion/garlic make it unsuitable as a treat.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (367, 'Subway turkey sandwich with veggies', 'fast food', 'CAUTION', 'Processed deli meat, bread, and toppings like onion; remove bread, sauces, and onion if a tiny amount of plain turkey is ever shared.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (368, 'Dominos cheese pizza slice', 'fast food', 'CAUTION', 'Cheese, tomato sauce, and crust; high fat and often seasoned with garlic/onion; not recommended.', '{aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (369, 'Starbucks bottled Frappuccino coffee drink', 'beverage', 'UNSAFE', 'Coffee-based drink with caffeine, sugar, and dairy; caffeine is toxic for dogs and these drinks should be avoided.', '{merckvetmanual.com,aspca.org,goodrx.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (370, 'basil (fresh herb)', 'herb', 'CAUTION', 'Fresh basil leaves in very small amounts are generally considered safe as an occasional topper; avoid seasoned dishes with onion/garlic.', '{preventivevet.com,volharddognutrition.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (371, 'parsley (flat-leaf)', 'herb', 'CAUTION', 'Small amounts of fresh parsley may be used as a garnish; avoid large quantities or use in dogs with kidney disease.', '{preventivevet.com,wholepetwellness.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (372, 'cilantro (coriander leaf)', 'herb', 'CAUTION', 'Fresh cilantro leaves in small quantities are usually tolerated; avoid spicy or seasoned salsas containing onion/garlic.', '{wholepetwellness.com,volharddognutrition.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (373, 'rosemary (fresh herb)', 'herb', 'CAUTION', 'Fresh rosemary in tiny amounts is generally considered safe; concentrated oils or large quantities are not recommended.', '{preventivevet.com,chewy.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (374, 'thyme (fresh herb)', 'herb', 'CAUTION', 'Fresh thyme in small amounts is usually safe as a light garnish; avoid heavy seasoning blends.', '{chewy.com,wholepetwellness.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (375, 'sage (culinary herb)', 'herb', 'CAUTION', 'Culinary sage in tiny amounts is likely safe; avoid large quantities and essential oils.', '{preventivevet.com,volharddognutrition.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (376, 'dill weed (fresh herb)', 'herb', 'CAUTION', 'Small pinches of fresh dill are generally safe; avoid pickled products high in salt.', '{preventivevet.com,chewy.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (377, 'mint leaves (peppermint/spearmint)', 'herb', 'CAUTION', 'Fresh culinary mint in small amounts may be tolerated; avoid mint candies, gums, or products with xylitol.', '{preventivevet.com,chewy.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (378, 'anise seed', 'spice', 'CAUTION', 'Anise seed is sometimes used in small amounts in dog treats; excess may cause GI upset.', '{volharddognutrition.com,chewy.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (379, 'fennel seed', 'spice', 'CAUTION', 'Fennel seed in very small quantities may be safe; avoid strong or concentrated preparations.', '{chewy.com,undertheweatherpet.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (380, 'bay leaf (dried)', 'spice', 'UNSAFE', 'Bay leaves contain essential oils that can cause GI upset and obstruction; do not allow dogs to eat whole leaves from cooked dishes.', '{preventivevet.com,lolahemp.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (381, 'cayenne pepper', 'spice', 'UNSAFE', 'Cayenne is not considered toxic but can severely irritate mouth, eyes, and GI tract; avoid in all foods for dogs.', '{preventivevet.com,chewy.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (382, 'paprika', 'spice', 'CAUTION', 'Paprika can irritate the digestive tract; avoid purposely feeding foods heavily seasoned with paprika.', '{preventivevet.com,chewy.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (383, 'mustard seed or powder', 'spice', 'UNSAFE', 'Mustard and mustard seeds can cause GI irritation and are generally considered unsafe for dogs.', '{chewy.com,preventivevet.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (384, 'vanilla extract (uncooked)', 'flavoring', 'UNSAFE', 'Contains alcohol, which can be toxic even in small amounts; do not let dogs lick liquid vanilla extract.', '{thesprucepets.com,globalsavors.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (385, 'vanilla bean or powder', 'flavoring', 'CAUTION', 'Small amounts of pure vanilla bean or powder baked into treats are usually safe; still adds sugar when in desserts.', '{thedogbakery.com,dogster.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (386, 'white flour (all-purpose)', 'grain', 'CAUTION', 'Refined flour has little nutritional value; small amounts in baked treats are usually tolerated but not necessary.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (387, 'water chestnuts (plain, canned and rinsed)', 'vegetable', 'SAFE', 'Plain water chestnuts in small pieces are generally safe as an occasional crunchy treat; avoid salty sauces.', '{akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (388, 'sauerkraut (plain, low-sodium)', 'fermented food', 'CAUTION', 'Fermented cabbage may be safe in tiny amounts but is often high in salt; many dogs may develop GI upset.', '{firstvet.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (389, 'pickles (dill, brine-packed)', 'fermented food', 'CAUTION', 'High in salt and sometimes garlic/onion; do not offer as a regular treat.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (390, 'salsa (tomato-onion-garlic)', 'sauce', 'UNSAFE', 'Most salsas contain onion/garlic and spicy peppers; avoid.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (391, 'hummus (store-bought)', 'spread', 'UNSAFE', 'Commonly contains garlic, lemon juice, salt, and oil; not recommended for dogs.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (392, 'black beans (plain cooked)', 'legume', 'SAFE', 'Plain cooked black beans (no salt/seasoning) in small amounts may be used as fiber/protein.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (393, 'kidney beans (plain cooked)', 'legume', 'CAUTION', 'Fully cooked kidney beans without seasoning can be safe in small amounts; raw beans are toxic.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (396, 'pinto beans (plain cooked)', 'legume', 'SAFE', 'Plain, well-cooked pinto beans in moderation can be safe; may cause gas if overfed.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (397, 'refried beans (canned, seasoned)', 'legume', 'CAUTION', 'Often contain fat, salt, and spices; avoid or offer only tiny tastes if unseasoned.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (398, 'baked beans (canned in sauce)', 'legume', 'CAUTION', 'Sweet sauces, salt, and sometimes onion make baked beans a poor choice for dogs.', '{petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (399, 'hemp seeds', 'seed', 'CAUTION', 'Hemp seeds are not known to be toxic but are high in fat; only small amounts if at all and avoid products with added seasonings.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (400, 'nutritional yeast (plain)', 'supplement', 'CAUTION', 'Generally considered safe in moderation and sometimes used as a supplement; introduce slowly and watch for GI upset.', '{greatpetcare.com,whiteoakvet.com,vivuspets.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (401, 'brewers yeast supplement', 'supplement', 'CAUTION', 'Often used in some dog products; individual dogs may react with GI upset or allergies; follow veterinary guidance.', '{brutusbroth.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (402, 'bakers yeast (active, raw)', 'other', 'UNSAFE', 'Like raw yeast dough, active baker''s yeast can expand and produce alcohol in the stomach; do not allow dogs to ingest.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (404, 'kombucha (fermented tea drink)', 'beverage', 'CAUTION', 'Contains caffeine, acids, sugar, and small amounts of alcohol; not recommended unless under direct veterinary guidance.', '{firstvet.com,dialavet.com,dig-in.com.au}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (405, 'sports drink (sugar-sweetened)', 'beverage', 'CAUTION', 'High in sugar and sodium; not necessary for dogs and may cause GI upset.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (406, 'sports drink (sugar-free with xylitol)', 'beverage', 'UNSAFE', 'Sugar-free sports drinks may contain xylitol, which can cause hypoglycemia and liver failure.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (407, 'lemonade (sugary beverage)', 'beverage', 'CAUTION', 'High sugar and citric acid; can upset stomach and contribute to obesity; avoid as a drink.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (408, 'fruit punch drink', 'beverage', 'CAUTION', 'Sugary beverage with little nutritional value; may contain grape juice or artificial sweeteners; avoid.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (409, 'hot chocolate beverage', 'beverage', 'UNSAFE', 'Contains cocoa and often milk/sugar; chocolate is toxic to dogs.', '{goodrx.com,merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (410, 'instant ramen noodles with seasoning packet', 'prepared food', 'UNSAFE', 'Seasoning packets are very high in salt and may contain onion/garlic; avoid feeding to dogs.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (411, 'instant noodles (plain, no seasoning)', 'prepared food', 'CAUTION', 'Plain cooked noodles offer little nutrition and lots of refined carbs; small amounts only.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (412, 'granola bar (chocolate chip)', 'dessert', 'UNSAFE', 'Often contains chocolate and sometimes raisins or xylitol; unsafe for dogs.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (413, 'granola bar (fruit and nut, no chocolate)', 'dessert', 'CAUTION', 'High in sugar, fat, and sometimes raisins; only tiny tastes if ingredients are dog-safe.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (414, 'whey protein powder (chocolate flavored)', 'supplement', 'UNSAFE', 'Contains cocoa and sometimes artificial sweeteners; do not feed to dogs.', '{goodrx.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (415, 'whey protein powder (unflavored)', 'supplement', 'CAUTION', 'Unflavored whey protein is not usually toxic but can upset digestion; use only under veterinary guidance.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (416, 'plant-based protein powder (pea/rice blend)', 'supplement', 'CAUTION', 'May be safe in small amounts but often contains flavorings or sweeteners; not formulated for dogs.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (417, 'Nutella hazelnut cocoa spread', 'dessert', 'UNSAFE', 'Contains cocoa, sugar, and fat; veterinary sources advise against giving Nutella to dogs.', '{goodrx.com,dogster.com,hepper.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (418, 'hazelnut spread (no cocoa)', 'spread', 'CAUTION', 'Very high in sugar and fat; small accidental licks are usually not toxic but it should not be offered as a treat.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (419, 'marshmallows (regular, sugar-sweetened)', 'dessert', 'CAUTION', 'High in sugar with no nutritional value; some vet sources say not recommended but small amounts are rarely toxic.', '{akc.org,petmd.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (420, 'marshmallows (sugar-free with xylitol)', 'dessert', 'UNSAFE', 'Sugar-free marshmallows may contain xylitol, which is highly toxic to dogs.', '{petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (421, 'gummy bears (regular, sugar-sweetened)', 'dessert', 'CAUTION', 'Very sugary and can be a choking hazard; some brands or sugar-free versions may contain xylitol.', '{bethelpethospital.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (422, 'gummy candy (sugar-free with xylitol)', 'dessert', 'UNSAFE', 'Sugar-free gummies often contain xylitol, which can cause severe hypoglycemia and liver damage.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (423, 'hard candy (fruit-flavored, no xylitol)', 'dessert', 'CAUTION', 'Choking hazard and high sugar; avoid offering to dogs.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (424, 'lollipop (sugar-free with xylitol)', 'dessert', 'UNSAFE', 'Sugar-free lollipops may contain xylitol; never allow dogs to eat them.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (425, 'energy gel packs (caffeinated)', 'supplement', 'UNSAFE', 'Contain concentrated caffeine and sugar, both dangerous for dogs.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (426, 'trail mix with chocolate and raisins', 'snack mix', 'UNSAFE', 'Combines two toxic ingredients for dogs: chocolate and raisins.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (427, 'trail mix without chocolate or raisins', 'snack mix', 'CAUTION', 'Often contains nuts, salt, and dried fruit; small accidental ingestion may be tolerated but not recommended as a snack.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (428, 'protein bar (chocolate coated)', 'snack', 'UNSAFE', 'Chocolate coating and possible xylitol or raisins make these unsafe.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (429, 'protein bar (no chocolate)', 'snack', 'CAUTION', 'May contain sweeteners, nuts, and other rich ingredients; avoid regular feeding.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (430, 'instant oatmeal packets (flavored)', 'grain', 'CAUTION', 'Flavored packets often contain sugar, salt, and sometimes raisins or chocolate; plain cooked oats are safer.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (432, 'rice cakes (caramel-flavored)', 'grain', 'CAUTION', 'Added sugar and flavorings make these less suitable; tiny pieces only if ingredients are dog-safe.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (433, 'banana chips (sweetened, fried)', 'snack', 'CAUTION', 'High in sugar and fat compared with fresh banana; use sparingly if at all.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (434, 'kale chips (seasoned)', 'snack', 'CAUTION', 'Seasonings and salt can be problematic even though kale itself is only safe in small amounts.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (435, 'apple chips (plain dried)', 'snack', 'CAUTION', 'Dried apples are high in natural sugar and can be sticky; small amounts only, avoiding added sugar.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (436, 'dried apricots', 'fruit', 'CAUTION', 'High in sugar and sometimes preserved with sulfites; remove pits and offer only tiny amounts.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (437, 'dates (dried)', 'fruit', 'CAUTION', 'Extremely sweet and calorie-dense; can cause loose stool if overfed.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (438, 'prunes (dried plums)', 'fruit', 'CAUTION', 'Laxative effect and high sugar; generally best avoided except tiny accidental amounts.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (439, 'cranberries (dried, sweetened)', 'fruit', 'CAUTION', 'Cranberries themselves can be safe in moderation but sweetened dried products add a lot of sugar.', '{petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (440, 'pancakes (plain, no syrup)', 'prepared food', 'CAUTION', 'Refined flour and fat with little nutritional value; small plain bites may be tolerated but not needed.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (441, 'waffles (plain, no syrup)', 'prepared food', 'CAUTION', 'Similar to pancakes; small plain pieces only if ingredients are dog-safe.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (442, 'pancake syrup (maple-flavored corn syrup)', 'sweetener', 'CAUTION', 'Very high in sugar; avoid as it can promote obesity and dental disease.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (443, 'french toast (with egg and sugar)', 'prepared food', 'CAUTION', 'Typically fried and sweetened; small unseasoned pieces only if free of nutmeg, raisins, or xylitol.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (444, 'frosting or icing (vanilla, no xylitol)', 'dessert', 'CAUTION', 'A mix of sugar and fat; not toxic in small licks but not appropriate as a treat.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (445, 'cake (vanilla, no chocolate/raisins/xylitol)', 'dessert', 'CAUTION', 'High in sugar and fat; small crumbs are unlikely to be toxic but should not be offered intentionally.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (446, 'brownies (chocolate)', 'dessert', 'UNSAFE', 'Chocolate in brownies can be quite concentrated and dangerous for dogs.', '{akc.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (447, 'cheesecake (plain)', 'dessert', 'CAUTION', 'Very rich in fat and sugar; can trigger pancreatitis in sensitive dogs.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (448, 'yogurt-covered raisins', 'dessert', 'UNSAFE', 'Contain raisins, which are toxic to dogs, plus sugar and fat.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (449, 'mac and cheese (boxed, prepared)', 'prepared food', 'CAUTION', 'High in fat and salt; small tastes are usually not toxic but not recommended as a meal.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (450, 'lasagna with tomato sauce and cheese', 'prepared food', 'CAUTION', 'Often contains onion/garlic and is rich in fat and salt; avoid feeding more than a tiny taste if ingredients are known.', '{aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (451, 'scrambled eggs with cheese (plain)', 'prepared food', 'CAUTION', 'Eggs are safe when cooked but added cheese and butter increase fat; small portions only.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (452, 'omelet with onion or garlic', 'prepared food', 'UNSAFE', 'Onion/garlic in omelets can damage red blood cells; do not feed.', '{aspca.org,merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (453, 'sushi (cooked fish and rice, no seasoning)', 'prepared food', 'CAUTION', 'Small portions of cooked fish and rice without soy sauce or wasabi may be safe; avoid raw fish and seasonings.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (454, 'sushi rolls with avocado, cream cheese, and seasoning', 'prepared food', 'CAUTION', 'High in fat and salt; may contain onion/garlic and raw fish; not recommended as a treat.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (455, 'seaweed salad (seasoned with soy sauce and sesame oil)', 'prepared food', 'CAUTION', 'Seasonings and salt can be problematic even though plain seaweed in tiny amounts may be safe.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (456, 'edible sprinkles or cake glitter', 'decorations', 'CAUTION', 'Mostly sugar and dyes; small accidental ingestion is usually not toxic but should not be fed on purpose.', NULL, '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (457, 'frosted breakfast cereal (no chocolate)', 'cereal', 'CAUTION', 'Very high in sugar and simple carbs; tiny amounts are usually not toxic but not recommended.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (458, 'frosted breakfast cereal with chocolate pieces', 'cereal', 'UNSAFE', 'Contains chocolate plus sugar; avoid offering to dogs.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (459, 'instant mashed potatoes (with butter and salt)', 'prepared food', 'CAUTION', 'Butter and salt make this rich; safe ingredients but not ideal in quantity.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (460, 'stuffing or dressing (bread with onion, herbs)', 'prepared food', 'UNSAFE', 'Stuffing commonly contains onion and sometimes garlic, which are toxic to dogs.', '{akc.org,aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (461, 'cranberry sauce (sweetened)', 'dessert', 'CAUTION', 'Cranberries can be safe but added sugar and sometimes raisins make this a poor choice.', '{petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (462, 'pumpkin pie (sweetened, spiced)', 'dessert', 'UNSAFE', 'Contains sugar, fat, and spices like nutmeg and clove that are not recommended; use plain pumpkin instead.', '{merckvetmanual.com,aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (463, 'apple pie (with sugar and spices)', 'dessert', 'CAUTION', 'Apples are safe but pie filling is sweetened and spiced, and crust is fatty; small crumbs only if no raisins or xylitol.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (464, 'pecan pie', 'dessert', 'CAUTION', 'Very rich dessert with high sugar and fat plus pecans, which can cause GI upset; avoid offering on purpose.', '{petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (465, 'pan-seared salmon in garlic butter', 'prepared food', 'UNSAFE', 'Garlic and high-fat butter make this unsafe despite salmon itself being dog-safe when plain.', '{aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (466, 'turkey skin and pan drippings', 'prepared food', 'UNSAFE', 'Extremely high in fat and often seasoned; strongly associated with pancreatitis risk in dogs.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
