INSERT INTO public.rules VALUES (9, 14, '{"part": "core"}', 'CAUTION', 'Remove core to reduce choking risk', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (10, 10, '{"part": "rind"}', 'CAUTION', 'Rind is tough and can cause GI upset; remove', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (11, 11, '{"part": "rind"}', 'CAUTION', 'Rind is tough and can cause GI upset; remove', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (12, 10, '{"part": "seeds"}', 'CAUTION', 'Remove seeds to prevent GI upset', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (13, 11, '{"part": "seeds"}', 'CAUTION', 'Remove seeds to prevent GI upset', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (14, 30, '{"part": "seeds"}', 'CAUTION', 'Remove seeds to prevent GI upset', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (15, 12, '{"part": "pit"}', 'UNSAFE', 'Remove mango pit (choking/obstruction risk)', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (16, 12, '{"part": "skin"}', 'CAUTION', 'Peels/skins can be irritating; serve peeled', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (17, 13, '{"part": "skin"}', 'CAUTION', 'Peels/skins can be irritating; serve peeled', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (18, 24, '{"part": "skin"}', 'CAUTION', 'Peels/skins can be irritating; serve peeled', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (19, 13, '{"part": "core"}', 'CAUTION', 'Remove pineapple core; tough/fibrous', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (20, 21, '{"part": "pit"}', 'UNSAFE', 'Pit is a major choking/obstruction hazard; contains persin', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (21, 21, '{"part": "skin"}', 'UNSAFE', 'Skin/leaves higher in persin; avoid', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (22, 21, '{"ripeness": "ripe_flesh"}', 'CAUTION', 'Small amounts of ripe flesh only; many guides advise avoiding entirely', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (23, 16, '{"part": "peel"}', 'CAUTION', 'Peel/pith oils can irritate GI; remove peel', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (24, 25, '{"part": "peel"}', 'CAUTION', 'Peel/pith oils can irritate GI; remove peel', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (25, 26, '{"part": "peel"}', 'CAUTION', 'Peel/pith oils can irritate GI; remove peel', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
